syntax = "proto3";

option java_package = "io.ennoo.fabric-client.grpc.proto.geneses";
option java_outer_classname = "ResultProto";
option go_package = "grpc/proto/geneses";

package geneses;

message String {
    string data = 1;
}

message CMDOut {
    int32 line = 1;
    repeated string prints = 2;
}